onaných %d akcií.','[{site_title}]: You\'ve got a new order: #{order_number}'=>'[{site_title}]: Máte novú objednávku: #{order_number}','We hope they’ll be back soon! Read more about <a href="https://woocommerce.com/document/managing-orders/">troubleshooting failed payments</a>.'=>'Dúfame, že sa čoskoro vrátia! Prečítajte si viac o <a href="https://woocommerce.com/document/managing-orders/">riešení problémov s neúspešnými platbami</a> .','Reset your password'=>'Obnovte svoje heslo','Reset your password for {site_title}'=>'Obnovte svoje heslo pre {site_title}','Order refunded: {order_number}'=>'Objednávka refundovaná: {order_number}','Order failed: #{order_number}'=>'Objednávka zlyhala: #{order_number}','Select who should be notified if an order that was previously processing or on-hold has failed.'=>'Vyberte, kto má byť upozornený, ak objednávka, ktorá sa predtým spracovávala alebo bola pozastavená, zlyhala.','Partial refund: Order {order_number}'=>'Čiastočné vrátenie peňazí: Objednávka {order_number}','A note has been added to your order from {site_title}'=>'K vašej objednávke bola pridaná poznámka od {site_title}','If you need any help with your order, please contact us at {store_email}.'=>'Ak potrebujete s objednávkou pomôcť, kontaktujte nás na adrese {store_email}.','Order cancelled: #{order_number}'=>'Objednávka zrušená: #{order_number}','Your order from {site_title} is on its way!'=>'Vaša objednávka z {site_title} je na ceste!','Good things are heading your way!'=>'Dobré veci smerujú k vám!','Thanks again! If you need any help with your order, please contact us at {store_email}.'=>'Ešte raz ďakujeme! Ak potrebujete pomoc s objednávkou, kontaktujte nás na adrese {store_email}.','Brands: '=>'Značky: ','The product with SKU (%1$s) you are trying to insert is already present in the lookup table'=>'Produkt s kódom SKU (%1$s), ktorý sa pokúšate vložiť, sa už nachádza vo vyhľadávacej tabuľke.','WC_Session is not available, customer data cannot be saved to session.'=>'