','Limit result set to virtual product variations.'=>'Obmedziť sadu výsledkov na variácie virtuálnych produktov.','Warning: Sale prices will be removed if they are not lower than regular prices.'=>'Upozornenie: Akciové ceny budú odstránené, ak nebudú nižšie ako bežné ceny.','block titleProduct Summary'=>'Zhrnutie produktu','block descriptionDisplay a short description about a product.'=>'Zobrazí krátky popis o produkte.','block descriptionDisplay an input field customers can use to select the number of products to add to their cart. '=>'Zobraziť vstupné pole s krokovým ovládačom na výber počtu produktov, ktoré chcete pridať do košíka.','Products in cart'=>'Produkty v košíku','Action needed'=>'Vyžaduje sa akcia','WooCommerce Settings'=>'Nastavenia WooCommerce','Sorry, your order on %1$s was unsuccessful. Your order details are below, with a link to try your payment again: %2$s'=>'Je nám ľúto, vaša objednávka na %1$s bola neúspešná. Údaje o vašej objednávke sú uvedené nižšie, spolu s odkazom na opätovný pokus o platbu: %2$s','Sync with theme'=>'Synchronizácia s témou','Stock availability class.'=>'Trieda dostupnosti zásob.','Stock availability text.'=>'Text o dostupnosti zásob.','Information about the product\'s availability.'=>'Informácia o dostupnosti produktu.','Order status slug.'=>'Slug stavu objednávky','Order statuses not found'=>'Stav objednávky nenájdený','Enable order data caching in the datastore. This feature only works with high-performance order storage.'=>'Povoliť ukladanie údajov o objednávkach do vyrovnávacej pamäte v úložisku údajov. Táto funkcia funguje iba s vysokovýkonným úložiskom objednávok.','HPOS Data Caching'=>'Ukladanie údajov do vyrovnávacej pamäte HPOS','Enables rate limiting for Checkout place order and Store API /checkout endpoint. To further control this, refer to <a href="%s" target="_blank">rate limiting documentation</a>.'=>'Umožňuje obmedzenie rýchlosti pre objednávku cez Checkout a koncový bod API obchodu/checkout. Ak chcete toto ďalej ovládať, pozrite si <a href="%s" target="_blank">dokumentáciu k obmedzeniu rýchlosti</a> .','Rate limit Checkout'=>'Limit sadzby Pokladňa','Stripe'=>'Stripe','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell in store and track sales and inventory in one place.'=>'Bezpečne prijímajte kreditné a debetné karty s nízkou sadzbou, bez akýchkoľvek prekvapivých poplatkov (k dispozícii sú vlastné sadzby). Predávajte v obchode a sledujte predaj a inventár na jednom mieste.','Clearpay allows customers to receive products immediately and pay for purchases over four installments, always interest-free.'=>'Clearpay umožňuje zákazníkom okamžite prijímať produkty a platiť za nákupy v štyroch splátkach, vždy bez úroku.','Clearpay'=>'Clearpay','Affirm\'s tailored Buy Now Pay Later programs remove price as a barrier, turning browsers into buyers, increasing average order value, and expanding your customer base.'=>'Programy Affirm na mieru „Kúp teraz, zaplať neskôr“ odstraňujú cenu ako bariéru, čím premieňajú návštevníkov na kupujúcich, zvyšujú priemernú hodnotu objednávky a rozširujú vašu zákaznícku základňu.','Credit/debit cards, Apple Pay, Google Pay, and more.'=>'Kreditné/debetné karty, Apple Pay, Google Pay a ďalšie.','Accept payments with Woo'=>'Prijímajte platby cez Woo','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Európske platobné riešenie, ktoré vám umožňuje prijímať platby vo viac ako 25 krajinách a viacerých menách.','Viva.com Smart Checkout'=>'Inteligentná pokladňa Viva.com','Accept credit and debit cards on your WooCommerce store with advanced features like partial refunds, full/partial captures, and 3D Secure security.'=>'Prijímajte kreditné a debetné karty vo svojom obchode WooCommerce s pokročilými funkciami, ako sú čiastočné vrátenie peňazí, úplné/čiastočné zachytenie a zabezpečenie 3D Secure.','Tilopay'=>'Tilopay','Enable PayU\'s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Povoľte exkluzívny doplnok PayU pre WooCommerce a začnite prijímať platby viac ako 100 platobnými metódami dostupnými v Indii vrátane kreditných kariet, debetných kariet, UPI a ďalších!','PayU India'=>'PayU India','Payoneer Checkout is the next generation of payment processing platforms, giving merchants around the world the solutions and direction they need to succeed in today\'s hyper-competitive global market.'=>'Payoneer Checkout je ďalšia generácia platforiem na spracovanie platieb, ktorá poskytuje obchodníkom na celom svete riešenia a smerovanie, ktoré potrebujú na úspech na dnešnom hyperkonkurenčnom globálnom trhu.','Safe and secure payments using your customer\'s PayPal account.'=>'Bezpečné a spoľahlivé platby pomocou účtu PayPal vášho zákazníka.','PayPal Payments lets you offer PayPal, Venmo (US only), Pay Later options and more.'=>'Platby cez PayPal vám umožňujú ponúkať možnosti PayPal, Venmo (iba v USA), Pay Later a ďalšie.','Paymob is a leading payment gateway in the Middle East and Africa. Accept payments online and in-store with Paymob.'=>'Paymob je popredná platobná brána na Blízkom východe a v Afrike. Prijímajte platby online aj v obchodoch s Paymobom.','Paymob'=>'Paymob','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa\'s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozšírenie Payfast pre WooCommerce vám umožňuje prijímať platby kreditnou kartou a EFT prostredníctvom jednej z najpopulárnejších platobných brán v Južnej Afrike. Žiadne poplatky za nastavenie ani mesačné poplatky za predplatné. Výberom tohto rozšírenia nakonfigurujete svoj obchod tak, aby ako vybranú menu používal juhoafrické randy.','The category of the suggestion.'=>'Kategória návrhu.','The tags associated with the suggestion.'=>'Značky súvisiace s návrhom.','The URL of the icon (square aspect ratio).'=>'URL ikony (štvorcový formát).','The URL of the image.'=>'URL obrázka.','The description of the suggestion.'=>'Popis návrhu.','The title of the suggestion.'=>'Názov návrhu.','Your trusted payments partner in Asia and around the world.'=>'Váš dôveryhodný platobný partner v Ázii a na celom svete.','Antom'=>'Antom','The type of the suggestion.'=>'Typ návrhu.','The priority of the suggestion.'=>'Priorita návrhu.','The unique identifier for the suggestion.'=>'Jedinečný identifikátor návrhu.','A suggestion with full details.'=>'Návrh s úplnými podrobnosťami.','The URL to hide the suggestion.'=>'URL adresa na skrytie návrhu.','The link to hide the suggestion.'=>'Odkaz na skrytie návrhu.','The URL to dismiss the incentive.'=>'URL adresa na zrušenie stimulu.','The link to dismiss the incentive.'=>'Odkaz na zrušenie stimulu.','Context ID in which the incentive was dismissed.'=>'ID kontextu, v ktorom bola motivácia zamietnutá.','The badge label for the incentive.'=>'Štítok odznaku pre motivačný bonus.','The URL to the terms and conditions for the incentive.'=>'URL adresa zmluvných podmienok pre stimul.','The call to action label for the incentive.'=>'Výzva na akciu pre danú stimuláciu.','The short description of the incentive. It can contain stylistic HTML.'=>'Stručný popis stimulu. Môže obsahovať štylistický HTML kód.','The incentive description. It can contain stylistic HTML.'=>'Popis stimulu. Môže obsahovať štylistický HTML kód.','The incentive title. It can contain stylistic HTML.'=>'Názov stimulu. Môže obsahovať štylistický HTML kód.','The incentive promo ID. This ID need to be fed into the onboarding flow.'=>'ID propagačnej akcie. Toto ID je potrebné zadať do procesu registrácie.','The incentive unique ID. This ID needs to be used for incentive dismissals.'=>'Jedinečné ID stimulu. Toto ID je potrebné 