ľa.','The URL to the settings page for the payment gateway.'=>'URL adresa stránky nastavení platobnej brány.','The link to the settings page for the payment gateway.'=>'Odkaz na stránku nastavení platobnej brány.','The management details of the provider.'=>'Podrobnosti o správe poskytovateľa.','Whether the provider is in dev mode. Having this true usually leads to forcing test payments. '=>'Či je poskytovateľ v režime vývojára. Ak je táto hodnota nastavená na „true“, zvyčajne to vedie k vynúteniu testovacích platieb. ','Whether the provider is in test mode for payments processing.'=>'Či je poskytovateľ v testovacom režime pre spracovanie platieb.','Whether the provider needs setup.'=>'Či poskytovateľ potrebuje nastavenie.','Whether the provider has a payments processing account connected.'=>'Či má poskytovateľ pripojený účet na spracovanie platieb.','Whether the provider is enabled for use on checkout.'=>'Či je poskytovateľ povolený na použitie pri platbe.','The general state of the provider with regards to it\'s payments processing.'=>'Všeobecný stav poskytovateľa, pokiaľ ide o spracovanie platieb.','The URL of the link.'=>'URL adresa odkazu.','The type of the link.'=>'Typ odkazu.','Links for the provider.'=>'Odkazy na poskytovateľa.','The URL of the provider icon (square aspect ratio - 72px by 72px).'=>'URL adresa ikony poskytovateľa (štvorcový pomer strán – 72px x 72px).','The URL of the provider image.'=>'URL adresa obrázka poskytovateľa.','The status of the plugin.'=>'Stav pluginu.','The plugin main file. This is a relative path to the plugins directory.'=>'Hlavný súbor pluginu. Toto je relatívna cesta k adresáru pluginov.','The slug of the plugin.'=>'Popis pluginu.','The type of the plugin.'=>'Typ pluginu.','The corresponding plugin details of the provider.'=>'Podrobnosti o zodpovedajúcom plugine poskytovateľa.','Supported features for this provider.'=>'Podporované funkcie pre tohto poskytovateľa.','The description of the provider.'=>'Popis poskytovateľa.','Th