konné úložisko objednávok.','Arts and crafts'=>'Umenie a remeslá','Sports and recreation'=>'Šport a rekreácia','You have <strong>%1$s Woo extension subscriptions</strong> that expired. <a href="%2$s">Renew</a> to continue receiving updates and streamlined support.'=>'Máte <strong>%1$s predplatných rozšírení Woo,</strong> ktoré vypršali. <a href="%2$s">Obnovte si ich</a> , aby ste naďalej dostávali aktualizácie a zjednodušenú podporu.','One of your subscriptions for <strong>%1$s</strong> has expired. <a href="%3$s">%4$s</a> to continue receiving updates and streamlined support.'=>'Platnosť jedného z vašich predplatných pre <strong>%1$s</strong> vypršala. <a href="%3$s">%4$s,</a> aby ste naďalej dostávali aktualizácie a zjednodušenú podporu.','Your subscription for <strong>%1$s</strong> expired. <a href="%3$s">%4$s</a> to continue receiving updates and streamlined support.'=>'Vaše predplatné pre <strong>%1$s</strong> vypršalo. <a href="%3$s">%4$s</a> budete môcť naďalej dostávať aktualizácie a zjednodušenú podporu.','Enable auto-renewal'=>'Povoliť automatické obnovenie','You have <strong>%1$s Woo extension subscriptions</strong> expiring soon. <a href="%2$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'Platnosť vašich <strong>predplatných rozšírení Woo (%1$s)</strong> čoskoro vyprší. <a href="%2$s">Povoľte automatické obnovenie</a> , aby ste mohli naďalej dostávať aktualizácie a zjednodušenú podporu.','One of your subscriptions for <strong>%1$s</strong> expires on %2$s. <a href="%3$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'Jedno z vašich predplatných pre <strong>%1$s</strong> vyprší %2$s. <a href="%3$s">Povoľte automatické obnovenie</a> , aby ste naďalej dostávali aktualizácie a zjednodušenú podporu.','Your subscription for <strong>%1$s</strong> expires on %2$s. <a href="%3$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'Vaše predplatné pre <strong>%1$s