ckfill %1$d --from=posts --to=hpos` to fix.'=>'Dáta v tabuľke príspevkov sa zdajú byť novšie ako v tabuľkách HPOS. Porovnajte dáta objednávky s `wp wc hpos diff %1$d` a na opravu použite `wp wc hpos backfill %1$d --from=posts --to=hpos`.','⚠️ The file system connection could not be initialized.'=>'⚠️ Pripojenie k súborovému systému sa nepodarilo inicializovať.','You may want to switch to the database for log storage.'=>'Možno budete chcieť prepnúť na databázu pre ukladanie protokolov.','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ Súborový systém nie je nakonfigurovaný na priame zápisy. To by mohlo spôsobiť problémy pre logger.','✅ Ready'=>'✅ Pripravené','Select your shipping options'=>'Vyberte svoje možnosti dopravy','Template namePage: Coming soon'=>'Stránka: Už čoskoro','
