		','Failed to clean up all orders in a batch. Aborting.'=>'Nepodarilo sa vyčistiť všetky objednávky v dávke. Prebieha prerušenie.','<a id="woo-connect-notice-url" href="%s">Connect your store</a> to WooCommerce.com to get updates and streamlined support for your subscriptions.'=>'<a id="woo-connect-notice-url" href="%s">Prepojte svoj obchod</a> s WooCommerce.com a získajte aktualizácie a zjednodušenú podporu pre svoje predplatné.','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'Váš obchod môže byť ohrozený, pretože používate staré verzie doplnkov WooCommerce.','Attribution'=>'Pripisovanie','Order attribution information.'=>'Informácie o priradení objednávky.','Something big is brewing! Our store is in the works and will be launching soon!'=>'Niečo veľké sa chystá! Náš obchod je vo vývoji a čoskoro bude spustený!','Great things are on the horizon'=>'Veľké veci sú na obzore','Name of credit cardCartes Bancaires'=>'Bankové karty','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Pri spracovaní vašej objednávky sa vyskytla chyba. Pred opätovným zadaním objednávky skontrolujte, či nie sú v spôsobe platby účtované nejaké poplatky, a skontrolujte <a href="%s">históriu objednávok</a> .',' <a href="%1$s" class="woocommerce-connect-your-store">Connect your store</a> to woocommerce.com to update.'=>' Pre aktualizáciu <a href="%1$s" class="woocommerce-connect-your-store">prepojte svoj obchod</a> s woocommerce.com.','block keywordselect'=>'zvoliť','block keywordcustom'=>'vlastné','block keywordfields'=>'polia','block descriptionThe product custom fields.'=>'Vlastné polia produktu.','block titleProduct custom fields control'=>'Ovládací prvok vlastných polí produktu','block descriptionThe product custom fields toggle.'=>'Vlastné polia produktu sa prepínajú.','block titleProduct custom fields toggle control'=>'Ovládací prvok prepínania vlastných polí produktu','block descriptionA select field for use in the product editor.'=>'Výberové pole na použitie v editore produktov.','block titleProduct select field'=>'Pole pre výber produktu','Site visibility'=>'Viditeľnosť stránky','Live'=>'Naživo','Approving will share credentials with %s. Do not proceed if this looks suspicious in any way.'=>'Schválením sa prihlasovacie údaje zdieľajú s %s. Ak to vyzerá akokoľvek podozrivo, nepokračujte.','Plugin installed by %1$s on %2$s.'=>'Plugin nainštalovaný používateľom %1$s dňa %2$s.','Plugin installed by %1$s on %2$s. <a target="_blank" href="%3$s">More information</a>'=>'Plugin nainštalovaný používateľom %1$s dňa %2$s. <a target="_blank" href="%3$s">Viac informácií</a>','Enter an optional note attached to the order confirmation message sent to the shopper.'=>'K potvrdzujúcej správe objednávky odoslanej kupujúcemu pridajte voliteľnú poznámku.','Post-purchase note'=>'Poznámka po zakúpení','Custom fields can be used in a variety of ways, such as sharing more detailed product information, showing more input fields, or for internal inventory organization. %1$sRead more about custom fields%2$s'=>'Vlastné polia sa dajú použiť rôznymi spôsobmi, napríklad na zdieľanie podrobnejších informácií o produkte, zobrazenie viacerých vstupných polí alebo na internú organizáciu zásob. %1$sPrečítajte si viac o vlastných poliach%2$s','Custom fields'=>'Vlastné polia','Show custom fields'=>'Zobraziť vlastné polia','Use global attributes to allow shoppers to filter and search for this product. Use custom attributes to provide detailed product information.'=>'Použite globálne atribúty, aby ste umožnili nakupujúcim filtrovať a vyhľadávať tento produkt. Použite vlastné atribúty na poskytnutie podrobných informácií o produkte.','Per your %1$sstore settings%2$s, taxes are not enabled.'=>'Podľa nastavení vášho obchodu %1$s%2$s nie sú dane povolené.','Unable to create backup post for order %d.'=>'Nepodarilo sa vytvoriť záložný príspevok pre objednávku %d.','The backup datastore does not support updating orders.'=>'Záložné úložisko údajov nepodporuje aktualizáciu objednávok.','New custom field name'=>'Názov nového vlastného poľa','Please review the errors above.'=>'Skontrolujte, prosím, vyššie uvedené chyby.','Overriding existing data with an already registered key is not allowed'=>'Prepísanie existujúcich údajov už registrovaným kľúčom nie je povolené.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'Vývojový režim WooCommerce Blocks vyžaduje zostavenie súborov. Z koreňového adresára spustite %1$s, aby ste sa uistili, že verzia vášho uzla je zarovnaná, spustite %2$s na inštaláciu závislostí, %3$s na zostavenie súborov alebo %4$s na zostavenie súborov a sledovanie zmien.','Key for the data being registered must be a string'=>'Kľúč pre registrované údaje musí byť reťazec','The metaboxhidden_product meta from the user metas.'=>'Metadáta metaboxhidden_product z metadát používateľa.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Nastavte si platobné metódy a akceptujte kreditné a debetné karty, hotovosť, bankové prevody a peniaze z vášho účtu Mercado Pago. Ponúknite bezpečné platby s popredným spracovateľom v Latinskej Amerike.','Grow your business'=>'Rozvíjajte svoje podnikanie','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Vyberať daň z predaja','Add your products'=>'Pridajte svoje produkty','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Je čas osláviť – ste pripravení spustiť svoj obchod! Paráda! Kliknite na tlačidlo pre zobrazenie ukážky vášho obchodu a jeho zverejnenie.','Launch your store'=>'Spustite svoj obchod','Get your products shipped'=>'Nechajte si doručiť svoje produkty','Current price is: %s.'=>'Aktuálna cena je: %s.','Original price was: %s.'=>'Pôvodná cena bola: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Pokladňu je možné prispôsobiť <a href="%s">v Editore</a> vašej aktívnej témy.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce sa pokúsil nainštalovať <a href="%1$s">doplnok Legacy REST API,</a> pretože táto stránka má <a href="%2$s">povolené rozhranie Legacy REST API</a> alebo <a href="%3$s">definované staršie webhooky</a> , ale inštalácia zlyhala (podrobnosti o chybe nájdete v <a href="%4$s">protokoloch WooCommerce</a> ). Nainštalujte a aktivujte doplnok manuálne. <a href="%5$s">Viac informácií</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce nainštaloval a aktivoval <a href="%1$s">doplnok Legacy REST API,</a> pretože táto stránka má <a href="%2$s">povolené Legacy REST API</a> alebo má <a href="%3$s">definované staršie webhooky</a> . <a href="%4$s">Viac informácií</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce nainštaloval doplnok Legacy REST API, ale nepodarilo sa ho aktivovať, ďalšie podrobnosti nájdete v kontexte.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce nainštaloval <a href="%1$s">doplnok Legacy REST API,</a> pretože táto stránka má <a href="%2$s">povolené Legacy REST API</a> alebo <a href="%3$s">definované staršie webhooky</a> , ale nepodarilo sa ho aktivovať (podrobnosti o chybe nájdete v <a href="%4$s">protokoloch WooCommerce</a> ). Prejdite na <a href="%5$s">stránku s doplnkami</a> a aktivujte ho manuálne. <a href="%6$s">Viac informácií</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Ak chcete použiť kód kupónu "%s", v pokladni zadajte platný e-mail.','Please enter a valid email to use coupon code "%s".'=>'Ak chcete použiť kód kupónu "%s", zadajte platný e-mail.','To allow logging, make %s writable.'=>'Ak chcete povoliť protokolovanie, nastavte %s ako zapisovateľný.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Objavte nový vylepšený spôsob doručenia, ktorý vám umožňuje jednoducho ponúknuť jedno alebo viacero miest vyzdvihnutia vašim zákazníkom na <a href="%s">stránke nastavenia miestneho vyzdvihnutia</a>.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Miestne vyzdvihnutie: Nastavte miesta vyzdvihnutia na <a href="%s">stránke nastavení miestneho vyzdvihnutia</a> .','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Zhromažďovanie údajov o používaní nám umožňuje prispôsobiť váš zážitok z nastavenia obchodu, ponúkať relevantnejší obsah a pomáhať vylepšovať WooCommerce pre všetkých.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Aktivujte si Správcu aktualizácií WooCommerce.com,</a> aby ste mohli naďalej dostávať aktualizácie a zjednodušenú podporu, ktoré sú súčasťou vašich predplatných WooCommerce.com.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'Ak chcete naďalej dostávať aktualizácie a zjednodušenú podporu, ktoré sú súčasťou vašich predplatných WooCommerce.com, <a href="%1$s">nainštalujte si Správcu aktualizácií WooCommerce.com</a> . Prípadne si ho môžete <a href="%2$s">stiahnuť</a> a nainštalovať manuálne.',' Activate WooCommerce.com Update Manager to update.'=>' Aktivujte Správcu aktualizácií WooCommerce.com pre aktualizáciu.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Nainštalujte si WooCommerce.com Update Manager</a> pre aktualizáciu.','block keywordtextarea'=>'textové pole','block keywordsubsection'=>'podsekcia','block keywordrich-text'=>'rich-text','block descriptionA text-area field for use in the product editor.'=>'Textové pole na použitie v editore produktov.','block titleProduct textarea block'=>'Blok textového poľa produktu','block descriptionThe product subsection description.'=>'Popis podsekcie produktu.','block titleProduct subsection description'=>'Popis podsekcie produktu','AID'=>'AID','Receipt'=>'Účet','Date Paid'=>'Dátum zaplatenia','Discount (%s)'=>'Zľava (%s)','Invalid %s provided.'=>'Zadané neplatné %s.','Internal server error'=>'Interná chyba servera','Sorry, you cannot delete resources.'=>'Prepáčte, zdroje nemôžete odstrániť.','Sorry, you cannot create resources.'=>'Prepáčte, nemôžete vytvárať zdroje.','Sorry, you cannot view re