ustomer Email'=>'E-mail zákazníka','You do not have permission to manage logging settings.'=>'Nemáte povolenie na správu nastavení protokolovania.','Database settings'=>'Nastavenia databázy','Log entries are stored in this database table: %s'=>'Záznamy protokolu sú uložené v tejto databázovej tabuľke: %s','File system settings'=>'Nastavenia súborového systému','⚠️ This directory does not appear to be writable.'=>'⚠️ Zdá sa, že do tohto adresára nie je možné zapisovať.','Log files are stored in this directory: %s'=>'Súbory denníka sú uložené v tomto adresári: %s','Logger'=>'Logger','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Toto nastavuje minimálnu úroveň závažnosti protokolov, ktoré sa budú ukladať. Nižšie úrovne závažnosti budú ignorované. „Žiadne“ znamená, že sa budú ukladať všetky protokoly.','Level threshold'=>'Prahová hodnota úrovne','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'Toto nastavenie tu nie je možné zmeniť, pretože je definované v konštante %1$s, pravdepodobne vo vašom súbore %2$s.','This sets how many days log entries will be kept before being auto-deleted.'=>'Toto nastavuje, koľko dní sa budú záznamy v protokole uchovávať pred automatickým vymazaním.','Retention period'=>'Doba uchovávania','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'Toto nastavenie tu nie je možné zmeniť, pretože ho nastavuje filter na hooku %s.','This determines where log entries are saved.'=>'Toto určuje, kam sa ukladajú položky protokolu.','Log storage'=>'Úložisko protokolov','This setting cannot be changed here because it is defined in the %s constant.'=>'Toto nastavenie tu nie je možné zmeniť, pretože je definované v konštante %s.','Note that if this setting is changed, any log entries that have already been recorded will remain stored in their current location, 