.g. For heavy items requiring higher postage'=>'napr. pre ťažké zásielky vyžadujúce vyššie poštovné','Slug (unique identifier) can be left blank and auto-generated, or you can enter one'=>'Slug (jedinečný identifikátor) môžete nechať prázdny a vygenerovať ho automaticky, alebo ho môžete zadať sami.','e.g. heavy-packages'=>'napr. ťažké balíky','Give your shipping class a name for easy identification'=>'Pomenujte svoju prepravnú triedu pre ľahkú identifikáciu','Use shipping classes to customize the shipping rates for different groups of products, such as heavy items that require higher postage fees.'=>'Pomocou tried prepravy si môžete prispôsobiť sadzby prepravy pre rôzne skupiny produktov, ako sú napríklad ťažké položky, ktoré vyžadujú vyššie poštovné.','Unknown error'=>'Neznáma chyba','Subscription not found'=>'Predplatné sa nenašlo','This product has been activated.'=>'Tento produkt bol aktivovaný.','There was an error activating this theme.'=>'Pri aktivácii tejto témy sa vyskytla chyba.','There was an error activating this plugin.'=>'Pri aktivácii tohto pluginu sa vyskytla chyba.','This product is already active.'=>'Tento produkt je už aktívny.','This product is not installed.'=>'Tento produkt nie je nainštalovaný.','We couldn\'t find a subscription for this product.'=>'Nepodarilo sa nám nájsť predplatné pre tento produkt.','There was an error disconnecting your subscription. Please try again.'=>'Pri odpojení vášho predplatného sa vyskytla chyba. Skúste to znova.','Your subscription has been disconnected.'=>'Vaše predplatné bolo odpojené.','There was an error connecting your subscription. Please try again.'=>'Pri pripájaní vášho predplatného sa vyskytla chyba. Skúste to znova.','Your subscription has been connected.'=>'Vaše predplatné bolo pripojené.','"%1$s" was removed from the cart. %2$s'=>'Položka „%1$s“ bola odstránená z košíka. %2$s','block descriptionDisplays WooCommerce page content.'=>'Zobrazuje obsah stránky WooCommerce.','block keywordtext'=>'text','b