nu objednávku.','block titleAdditional Information'=>'Ďalšie informácie','block descriptionRenders classic WooCommerce shortcodes.'=>'Vykresľuje klasické shortcody WooCommerce.','block titleClassic Shortcode'=>'Klasický krátky kód','block descriptionThe product downloads.'=>'Produkt sa stiahne.','block titleProduct downloads'=>'Stiahnutia produktov','block descriptionA text field for use in the product editor.'=>'Textové pole na použitie v editore produktov.','block titleProduct text field'=>'Textové pole produktu','block descriptionA reusable number field for the product editor.'=>'Znovupoužiteľné číselné pole pre editor produktov.','block titleProduct number control'=>'Kontrola čísla produktu','block descriptionA reusable checkbox for the product editor.'=>'Znovupoužiteľné zaškrtávacie políčko pre editor produktov.','days'=>'dní','Themes'=>'Témy','Search results'=>'Výsledky vyhľadávania','Background sync is enabled.'=>'Synchronizácia na pozadí je povolená.','Add and manage attributes used for product options, such as size and color.'=>'Pridajte a spravujte atribúty používané pre možnosti produktu, ako napríklad veľkosť a farbu.','This product requires shipping or pickup'=>'Tento produkt vyžaduje prepravu alebo osobný odber','This variation requires shipping or pickup'=>'Táto variácia vyžaduje dopravu alebo osobný odber','Same as main product'=>'Rovnaké ako hlavný produkt','Add any files you\'d like to make available for the customer to download after purchasing, such as instructions or warranty info.'=>'Pridajte všetky súbory, ktoré chcete sprístupniť zákazníkovi na stiahnutie po zakúpení, napríklad pokyny alebo informácie o záruke.','Variation details'=>'Podrobnosti o variácii','<strong>You’re editing details specific to this variation.</strong> Some information, like description and images, will be inherited from the main product, <noticeLink><parentProductName/></noticeLink>.'=>'<strong>Upravujete podrobnosti špecifické pre túto variáciu.</strong> Nie