ky.','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'Vašu objednávku nie je možné spracovať, pretože pôvodná banka/obchodník vašu transakciu odmietol. Skúste nákup zopakovať.','Thank you. Your order has been fulfilled.'=>'Ďakujeme. Vaša objednávka bola vybavená.','Your order was refunded %s.'=>'Vaša objednávka bola vrátená vo výške %s.','Your order has been cancelled.'=>'Vaša objednávka bola zrušená.','Learn about new products and discounts'=>'Zoznámte sa s novými produktami a zľavami.','Placeholder image used to represent products being showcased under the social media icons. 4 out of 4.'=>'Zástupný obrázok použitý na znázornenie produktov prezentovaných pod ikonami sociálnych médií. 4 zo 4.','Placeholder image used to represent products being showcased under the social media icons. 3 out of 4.'=>'Zástupný obrázok použitý na znázornenie produktov prezentovaných pod ikonami sociálnych médií. 3 zo 4.','Placeholder image used to represent products being showcased under the social media icons. 2 out of 4.'=>'Zástupný obrázok použitý na znázornenie produktov prezentovaných pod ikonami sociálnych médií. 2 zo 4.','Placeholder image used to represent products being showcased under the social media icons. 1 out of 4.'=>'Zástupný obrázok použitý na znázornenie produktov prezentovaných pod ikonami sociálnych médií. 1 zo 4.','Placeholder image used to represent a product being showcased.'=>'Zástupný obrázok slúžiaci na znázornenie prezentovaného produktu.','Attribute term.'=>'Atribútový termín.','Limit result set to products with specified attributes.'=>'Obmedziť sadu výsledkov na produkty so zadanými atribútmi.','Default values for generated variations.'=>'Predvolené hodnoty pre vygenerované variácie.','Legacy'=>'Zastaralé','Page where shoppers go to finalize their purchase'=>'Stránka, na ktorej zákazníci dokončia svoj nákup','Page where shoppers review their shopping cart'=>'Stránka, kde si nakupujúci prezerajú svoj nákupný košík','⚠️ The WooCommerce Legacy REST API has been removed from WooCommerce, this will cause <a href="%1$s">webhooks on this site that are configured to use the Legacy REST API</a> to stop working. <a target="_blank" href="%2$s">A separate WooCommerce extension is available</a> to allow these webhooks to keep using the Legacy REST API without interruption. You can also edit these webhooks to use the current REST API version to generate the payload instead. <b><a target="_blank" href="%3$s">Learn more about this change.</a></b>'=>'⚠️ Rozhranie WooCommerce Legacy REST API bolo z WooCommerce odstránené. Z tohto dôvodu prestanú fungovať <a href="%1$s">webhooky na tejto stránke, ktoré sú nakonfigurované na používanie rozhrania Legacy REST API</a> . <a target="_blank" href="%2$s">K dispozícii je samostatné rozšírenie WooCommerce,</a> ktoré týmto webhookom umožňuje naďalej používať rozhranie Legacy REST API bez prerušenia. Tieto webhooky môžete tiež upraviť tak, aby na generovanie užitočného zaťaženia používali aktuálnu verziu rozhrania REST API. <b><a target="_blank" href="%3$s">Získajte viac informácií o tejto zmene.</a></b>','WooCommerce webhooks that use the Legacy REST API are unsupported'=>'Webhooky WooCommerce, ktoré používajú staršie rozhranie REST API, nie sú podporované.','block titleTaxonomy'=>'Taxonómia','block keywordtaxonomy'=>'taxonómia','block titleProduct Tag'=>'Značka produktu','block descriptionDisplay next and previous buttons.'=>'Zobraziť tlačidlá Ďalej a Predchádzajúce.','block titleNext/Previous Buttons'=>'Tlačidlá Ďalej/Predchádzajúce','block descriptionA block that displays a taxonomy field, allowing searching, selection, and creation of new items'=>'Blok, ktorý zobrazuje pole taxonómie a umožňuje vyhľadávanie, výber a vytváranie nových položiek','Logo'=>'Logo','HPOS enabled.'=>'HPOS povolené.','HPOS disabled.'=>'HPOS nepovolené.','New, faster way to find extensions and themes for your WooCommerce store'=>