ication for another account: %1$s. Order ID: %2$d.'=>'Prijaté upozornenie PDT pre iný účet: %1$s. ID objednávky: %2$d.','Received PDT notification for order %1$d on endpoint for order %2$d.'=>'Na koncovom bode objednávky %2$d bolo prijaté oznámenie PDT pre objednávku %1$d.','block titleCheckout'=>'Pokladňa','block keywordWooCommerce'=>'WooCommerce','block titleMini-Cart Items'=>'Položky mini košíka','block descriptionDisplay a checkout form so your customers can submit orders.'=>'Zobrazte pokladničný formulár, aby vaši zákazníci mohli odoslať objednávky.','block descriptionContains the products table and other custom blocks of filled mini-cart.'=>'Obsahuje tabuľku produktov a ďalšie vlastné bloky naplneného mini košíka.','Email address (optional)'=>'E-mailová adresa (voliteľné)','This means that the table is probably in an inconsistent state. It\'s recommended to run a new regeneration process or to resume the aborted process (Status - Tools - Regenerate the product attributes lookup table/Resume the product attributes lookup table regeneration) before enabling the table usage.'=>'To znamená, že tabuľka je pravdepodobne v nekonzistentnom stave. Pred povolením používania tabuľky sa odporúča spustiť nový proces regenerácie alebo obnoviť prerušený proces (Stav - Nástroje - Obnoviť vyhľadávaciu tabuľku atribútov produktu/Obnoviť regeneráciu vyhľadávacej tabuľky atribútov produktu).','Resume'=>'Pokračovať','WARNING: The product attributes lookup table regeneration process was aborted.'=>'UPOZORNENIE: Proces regenerácie vyhľadávacej tabuľky atribútov produktu bol prerušený.','Product attributes lookup table regeneration process has been resumed.'=>'Proces regenerácie vyhľadávacej tabuľky atribútov produktu bol obnovený.','This tool will resume the product attributes lookup table regeneration at the point in which it was aborted (%1$s products were already processed).'=>'Tento nástroj obnoví regeneráciu vyhľadávacej tabuľky atribútov produktov v bode, v ktorom bola pr