s directory'=>'V adresári s nahranými súbormi sa našli potenciálne nezabezpečené súbory','Direct updates'=>'Priame aktualizácie','Edit page'=>'Upraviť stránku','Page slugrefund_returns'=>'reklamacie','%1$s at %2$s %3$s'=>'%1$s o %2$s %3$s','Enable table usage'=>'Povoliť používanie tabuľky','Page titleRefund and Returns Policy'=>'Zásady vrátenia peňazí a reklamácií','Enable WooCommerce Analytics'=>'Povoliť WooCommerce Analytics','Update the table directly upon product changes, instead of scheduling a deferred update.'=>'Aktualizujte tabuľku priamo pri zmenách produktu, namiesto plánovania odloženej aktualizácie.','Use the product attributes lookup table for catalog filtering.'=>'Na filtrovanie katalógu použite vyhľadávaciu tabuľku atribútov produktu.','These settings are not available while the lookup table regeneration is in progress.'=>'Tieto nastavenia nie sú k dispozícii počas regenerácie vyhľadávacej tabuľky.','Product attributes lookup table'=>'Vyhľadávacia tabuľka atribútov produktu','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'Vyberte produkt, pre ktorý chcete regenerovať údaje, alebo nechajte pole prázdne pre regeneráciu celej tabuľky:','Additional data to pass to the extension'=>'Ďalšie údaje, ktoré sa majú odovzdať rozšíreniu','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'Názov rozšírenia – tento názov sa použije na zabezpečenie správneho smerovania údajov v požiadavke.','N. Revenue (formatted)'=>'N. Príjmy (naformátované)','Net total revenue (formatted).'=>'Čistý celkový príjem (formátovaný).','When true, refunded items are restocked.'=>'Ak je hodnota true, vrátené položky sa znova naskladnia.','Shipping Phone Number'=>'Telefónne číslo pre doručovanie','Billing Phone Number'=>'Fakturačné telefónne číslo','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Vytvorili sme pre vás vzorový návrh stránky s pravidlami pre vrátenie tovaru a vrátenie tovaru. Pozrite si ho a aktualizujte ho tak, aby vyhovoval vášmu obchodu.','Setup a Refund and Returns Policy page to boost your store\'s credibility.'=>'Nastavte si stránku s pravidlami vrátenia tovaru a vrátenia tovaru, aby ste zvýšili dôveryhodnosť svojho obchodu.','Limit result set to products that are low or out of stock. (Deprecated)'=>'Obmedziť sadu výsledkov na produkty, ktoré sú málo skladom alebo nie sú na sklade. (Zastarané)','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'%1$s sa nepodarilo spracovať pomocou metódy Vynútené stiahnutie. Namiesto toho sa použije presmerovanie.','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'Súbor %1$s sa nepodarilo obslúžiť pomocou metódy X-Accel-Redirect/X-Sendfile. Namiesto toho sa použije vynútené stiahnutie.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Ak je vybratá metóda sťahovania „Vynútiť sťahovanie“ alebo „X-Accel-Redirect/X-Sendfile“, ale nefunguje, systém použije metódu „Presmerovanie“ ako poslednú možnosť. Viac informácií <a href="%1$s">nájdete v tejto príručke</a> .','Allow using redirect mode (insecure) as a last resort'=>'Povoliť použitie režimu presmerovania (nezabezpečeného) ako poslednú možnosť','Set your store location and where you\'ll ship to.'=>'Nastavte si umiestnenie svojej predajne a kam budete zásielku doručovať.','Choose payment providers and enable payment methods at checkout.'=>'Vyberte si poskytovateľov platobných služieb a pri platbe povoľte spôsoby platby.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Ste už len krok od prijatia platby. Overte si údaje o svojej firme a začnite spravovať transakcie pomocou WooPayments.','Get backups'=>'Získajte zálohy','Grow your store'=>'Rozvíjajte váš obchod','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Začnite pridaním prvého produktu do vášho obchodu. Produkty môžete pridať manuálne, prostredníctvom súboru CSV alebo ich importovať z inej služby.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Adresa vašej predajne je potrebná na nastavenie krajiny pôvodu pre doručenie, meny a možnosti platby.','Set your store location and configure tax rate settings.'=>'Nastavte umiestnenie svojej predajne a nakonfigurujte nastavenia daňovej sadzby.','The rate at which tax is applied.'=>'Sadzba, ktorou sa daň uplatňuje.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Poznámky nie sú k dispozícii, pretože úložisko údajov „admin-note“ nie je možné načítať.','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Prestoje v obchode znamenajú stratu predaja. Obnovenie jedným kliknutím vás rýchlo vráti späť do prevádzky, ak sa niečo pokazí.','Protect your WooCommerce Store with Jetpack Backup.'=>'Chráňte svoj obchod WooCommerce pomocou Jetpack Backup.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Rozšírenie Payfast pre WooCommerce vám umožňuje prijímať platby kreditnou kartou a EFT prostredníctvom jednej z najpopulárnejších platobných brán v Južnej Afrike. Žiadne poplatky za nastavenie ani mesačné poplatky za predplatné. Výberom tohto rozšírenia nakonfigurujete svoj obchod tak, aby ako vybranú menu používal juhoafrické randy.','Products sold'=>'Predané produkty','Source of note.'=>'Zdroj poznámky.','Download %d ID'=>'Stiahnuť %d ID','Change status to cancelled'=>'Zmeniť stav na zrušená','Variations Sold'=>'Predané varianty','Data store:'=>'Uloženie údajov:','Number of variation items sold.'=>'Počet predaných variantov položiek.','Number of product items sold.'=>'Počet predaných kusov produktu.','This section shows details of Action Scheduler.'=>'Táto časť zobrazuje podrobnosti o Plánovači akcií.','Products by Rating list'=>'Produkty podľa hodnotenia','Recently Viewed Products list'=>'Zoznam naposledy zobrazených produktov','Things to do next'=>'Čo robiť ďalej','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Spravujte transakcie bez toho, aby ste opustili svoj WordPress panel. Iba s WooPayments.','How easy was it to add a product tag?'=>'Aké ľahké bolo pridať značku produktu?','A link to a product.'=>'Odkaz na produkt.','Invalid path provided.'=>'Zadaná cesta nie je platná.','Product Link'=>'Odkaz na produkt','Product Tag Link'=>'Odkaz na značku produktu','Product Category Link'=>'Odkaz na produktovú kategóriu','A link to a product tag.'=>'Odkaz na značku produktu.','A link to a product category.'=>'Odkaz na kategóriu produktu.','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Ak chcete zabezpečiť, aby oznámenia z vášho obchodu prišli do vašich schránok a schránok vašich zákazníkov, odporúčame pripojiť e-mailovú adresu k vašej doméne a nastaviť vyhradený server SMTP. Ak sa zdá, že sa niečo neodosiela správne, nainštalujte si doplnok <a href="%1$s">WP Mail Logging Plugin</a> alebo si pozrite <a href="%2$s">stránku Častých otá