optional)'=>'%s (voliteľné)','Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Povoľte exkluzívny doplnok PayU pre WooCommerce a začnite prijímať platby viac ako 100 platobnými metódami dostupnými v Indii vrátane kreditných kariet, debetných kariet, UPI a ďalších!','Get ready to start selling'=>'Pripravte sa na zahájenie predaja','PayU for WooCommerce'=>'PayU pre WooCommerce','Integration "%s" is not registered.'=>'Integrácia "%s" nie je registrovaná.','%1$s and %2$s'=>'%1$s a %2$s','Block name is required.'=>'Názov bloku je povinný.','"%s" is already registered.'=>'"%s" je už registrované.','Integration registry requires an identifier.'=>'Integračný register vyžaduje identifikátor.','There was an error with an item in your cart.'=>'S položkou vo vašom košíku sa vyskytla chyba.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'Na sklade nie je dostatok %s. Znížte množstvo v košíku.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'Na sklade nie je dostatok %s. Znížte množstvo v košíku.','%s cannot be purchased. Please remove them from your cart.'=>'%s nie je možné zakúpiť. Prosím, odstráňte ich z košíka.','%s cannot be purchased. Please remove it from your cart.'=>'%s sa nedá kúpiť. Prosím, odstráňte ho z košíka.','%s are out of stock and cannot be purchased. Please remove them from your cart.'=>'%s sú vypredané a nie je možné ich zakúpiť. Prosím, odstráňte ich z košíka.','%s is out of stock and cannot be purchased. Please remove it from your cart.'=>'%s nie je na sklade a nie je možné ho zakúpiť. Prosím, odstráňte ho z košíka.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'V košíku je príliš veľa %s. Dá sa kúpiť iba 1 kus z každého. Znížte počet kusov v košíku.','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'V košíku je príliš veľa %s. Je možné zakúpiť iba 1. Znížte množstvo v košíku.','of'=>'z','Step'=>'Krok','WooCommerce Setup'=>'Nastavenie WooCommerce','Start selling'=>'Začnite predávať','Search for a page&hellip;'=>'Hľadať stránku&hellip;','Tax class slug is invalid'=>'Daňová trieda je neplatná','City name, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'cities\' should be used instead.'=>'Názov mesta, nepodporuje viacero hodnôt. Zastarané od verzie WooCommerce 5.3, namiesto toho by sa malo používať „mestá“.','Postcode/ZIP, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'postcodes\' should be used instead.'=>'PSČ, nepodporuje viacero hodnôt. Zastarané od WooCommerce 5.3, namiesto toho by sa mali používať „postcodes“.','List of city names. Introduced in WooCommerce 5.3.'=>'Zoznam názvov miest. Zavedené vo WooCommerce 5.3.','List of postcodes / ZIPs. Introduced in WooCommerce 5.3.'=>'Zoznam poštových smerovacích čísel. Zavedené vo WooCommerce 5.3.','Amount that will be refunded for this tax.'=>'Suma, ktorá bude vrátená za túto daň.','Amount that will be refunded for this line item (excluding taxes).'=>'Suma, ktorá bude vrátená za túto riadkovú položku (bez daní).','Low Stock amount for the variation.'=>'Nízka zásoba pre danú variáciu.','Limit result set to resources assigned to a specific parent. Applies to hierarchical taxonomies only.'=>'Obmedziť množinu výsledkov na zdroje priradené ku konkrétnemu nadradenému objektu. Vzťahuje sa iba na hierarchické taxonómie.','Offset the result set by a specific number of items. Applies to hierarchical taxonomies only.'=>'Odsadiť výslednú množinu o určitý počet položiek. Vzťahuje sa iba na hierarchické taxonómie.','Low Stock amount for the product.'=>'Nízke skladové zásoby daného produktu.','Coupon item ID is readonly.'=>'ID položky kupónu je len na čítanie.','Additional tax class "%1$s" couldn\'t be saved. %2$s.'=>'Dodatočnú daňovú