ploaded theme.'=>'Nahraná téma.','A zip file of the theme to be uploaded.'=>'Súbor zip témy, ktorá sa má nahrať.','Theme installation message.'=>'Správa o inštalácii témy.','Theme installation status.'=>'Stav inštalácie témy.','Sorry, you are not allowed to install themes on this site.'=>'Ľutujeme, nemáte povolenie inštalovať témy na tento web.','Revenue'=>'Tržby','Your Report Download'=>'Stiahnutie prehľadu','Sorry, you are not allowed to create new pages.'=>'Ľutujeme, nemáte povolenie vytvárať nové stránky.','Limit result set to items that have the specified rate ID(s) assigned.'=>'Obmedziť výsledok nastavený na položky, ktoré majú priradené zadané ID.','Search by similar tax code.'=>'Vyhľadajte podľa podobného daňového kódu.','Limit result set to orders matching part of an order number.'=>'Limit výsledku nastavený na objednávky obsahujúce časti čísla objednávky.','Specified file failed upload test.'=>'Skúška nahrania súboru zlyhala.','An endpoint used for searching download logs for a specific IP address.'=>'Koncový bod používaný na vyhľadávanie protokolov sťahovania pre konkrétnu adresu IP.','Search by similar product name or sku.'=>'Vyhľadajte podľa podobného názvu produktu alebo sku.','[{site_title}]: Your {report_name} Report download is ready'=>'[{site_title}]: Stiahnutie prehľadu {report_name}  je pripravené','Homepage created'=>'Domovská stránka vytvorená','Content…'=>'Obsah…','Write title…'=>'Napíšte názov…','Get Started'=>'Začíname','Renew Subscription'=>'Obnoviť predplatné','Enable Autorenew'=>'Povoliť automatické obnovovanie','Your subscription expired on %s. Get a new subscription to continue receiving updates and access to support.'=>'Platnosť predplatného vypršala dňa %s. Získajte nové predplatné na pokračovanie v prijímaní aktualizácií a prístupu k podpore.','%s subscription expired'=>'Platnosť predplatného %s vypršala','Your subscription expires in %d days. Enable autorenew to avoid losing updates and access to support.'=>'Platnosť predplatného vy