l. Vždy môžete navštíviť %1$sNastavenia%3$s a zvoliť zastavenie zdieľania údajov. %2$sČítajte viac%3$s o tom, aké údaje zhromažďujeme.','Review'=>'Recenzia','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Gratulujeme k získaniu vašej prvej objednávky! Teraz je skvelý čas, aby ste sa naučili spravovať objednávky.','Report table data is being deleted.'=>'Údaje tabuľky prehľadov sa odstraňujú.','Report table data is being rebuilt. Please allow some time for data to fully populate.'=>'Údaje tabuľky prehľadov sa obnovujú. Počkajte, kým sa údaje úplne nenaplnia.','An import is already in progress. Please allow the previous import to complete before beginning a new one.'=>'Import už prebieha. Predtým, ako začnete nový, nechajte dokončiť predchádzajúci import.','The admin note date prop cannot be empty.'=>'Dátum poznámky správcu nemôže byť prázdny.','The admin note source prop cannot be empty.'=>'Zdroj poznámky správcu nemôže byť prázdny.','The admin note status prop (%s) is not one of the supported statuses.'=>'Stav poznámky správcu (%s) nie je jedným z podporovaných stavov.','The admin note status prop cannot be empty.'=>'Stav poznámky správcu nemôže byť prázdny.','The admin note content_data prop must be an instance of stdClass.'=>'The admin note content_data prop must be an instance of stdClass.','The admin note action name prop cannot be empty.'=>'Názov akcie poznámky správcu nemôže byť prázdny.','The admin note action label prop cannot be empty.'=>'Štítok akcie poznámky správcu nemôže byť prázdny.','The admin note title prop cannot be empty.'=>'Názov poznámky správcu nemôže byť prázdny.','The admin note content prop cannot be empty.'=>'Obsah poznámky správcu nemôže byť prázdny.','The admin note locale prop cannot be empty.'=>'Jazyk poznámky správcu nemôže byť prázdny.','The admin note type prop (%s) is not one of the supported types.'=>'Typ poznámky administrátora (%s) nie je jedným z podporovaných typov.','The 