ategória produktov by mala byť exportovaná?','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>Vaša téma (%s) obsahuje zastarané kópie niektorých súborov šablón WooCommerce.</strong> Tieto súbory môžu potrebovať aktualizáciu, aby boli kompatibilné s aktuálnou verziou WooCommerce. Návrhy na opravu tohto:','When handling an %s, should personal data within orders be retained or removed?'=>'Pri spracovaní %s, majú byť osobné údaje z objednávok zachované alebo odstránené?','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'Pri spracovaní %s, má byť prístup k súborom na stiahnutie zrušený a logy stiahnutí vyčistené?','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Ak chcete ponúknuť od konkrétneho dopravcu <span class="help_tip" data-tip="%1$s">živé sadzby,</span> mnoho rozšírení pre WooCommerce nájdete <a href="%2$s" target="_blank">tu</a>.','ShipStation icon'=>'ShipStation ikona','Low stock amount'=>'Nízke skladové zásoby','WooCommerce PayPal Checkout Gateway'=>'WooCommerce PayPal platobná brána','Set up Stripe for me using this email:'=>'Nastaviť Stripe použitím tohto e-mailu:','WooCommerce Services icon'=>'Ikona WooCommerce Services','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Vytvorili sme dve zóny dopravy - pre %s a pre zvyšok sveta. Nižšie môžete pre tieto zóny nastaviť paušálnu sadzbu poštovného alebo ponúknúť bezplatnú dopravu. ','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Použijeme %1$s ako váhu produktu a %2$s ako rozmery produktu.','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Odporúčame používať službu ShipStation, ktorá vám ušetrí čas strávený na pošte tým, že si môžete vytlačiť svoje prepravné štítky doma. Vyskúšajte ShipStation na 30 dní zadarmo.','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Sadzba na živo je presná cena za odoslanie objednávky, uvedená priamo od prepravcu.','Alto Paraguay'=>'Alto Paraguay','Presidente Hayes'=>'Presidente Hayes','Cordillera'=>'Cordillera','San Pedro'=>'San Pedro','Amambay'=>'Amambay','Meters'=>'Metre','Millimeters'=>'Milimetre','Yards'=>'Yardy','Centimeters'=>'Centimetre','Sud Sardegna'=>'Sud Sardegna','Central'=>'Centrálny','You may need to manually restore the item\'s stock.'=>'Možno budete musieť manuálne obnoviť skladové zásoby položky.','Kilograms'=>'Kilogramov','Grams'=>'Gramov','Pounds'=>'Libier','Ounces'=>'Uncí','Inches'=>'Palcov','Are you sure you want to remove the selected items?'=>'Ste si istý, že chcete odobrať vybrané položky?','Item moved up'=>'Posunúť položku vyššie','Item moved down'=>'Posunúť položku nižšie','%d API key permanently revoked.'=>'%d API kľúč trvalo zrušený.' . "\0" . '%d API kľúče trvalo zrušené.' . "\0" . '%d API kľúčov trvalo zrušených.','Apartment, suite, unit, etc.'=>'Apartmán, suita, byt atď.','Cannot set attributes due to invalid parent product.'=>'Nie je možné nastaviť atribúty kvôli neplatnému nadradenému produktu.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Táto akcia sa nedá zvrátiť. Naozaj chcete vymazať osobné údaje z vybratých objednávok?','shipping packagesShipping %d'=>'Poštovné %d','Shipping Address 1'=>'Adresa doručenia 1','Billing Address 1'=>'Fakturačná adresa 1','Billing Address'=>'Fakturačná adresa','Shipping Address'=>'Dodacia adresa','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'CSV musí obsahovať stĺpce v konkrétnom poradí. %1$sKliknutím sem stiahnete vzor%2$s.','Payer PayPal address'=>'PayPal adresa platcu','Payer last name'=>'Priezvisko platcu','MySQL version string.'=>'Reťazec MySQL verzie','Payer first name'=>'Krstné meno platcu','This will be how your name will be displayed in the account section and in reviews'=>'Takto sa bude vaše meno zobrazovať v sekcii účtu a v recenziách','United States (US) dollar'=>'Americký dolár','privacy policy'=>'pravidlá ochrany súkromia','terms and conditions'=>'všeobecné obchodné podmienky','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'Služba PayPal nám umožňuje odoslať jednu adresu. Ak používate službu PayPal na odosielanie štítkov, môžete radšej odoslať dodaciu adresu ako fakturáciu. Vypnutie tejto možnosti môže zabrániť tomu, aby PayPal predával ochranu pred aplikáciou.','eCheck ending in %1$s'=>'eCheck končí na %1$s','Other locations'=>'Ďalšie lokality','Required'=>'Povinné','Account details:'=>'Detaily účtu:','%s page'=>'%s strana','%s field'=>'%s pole','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Any &quot;%1$s&quot; method'=>'Akákoľvek &quot;%1$s&quot; metóda','No page set'=>'Nie je zvolená žiadna stránka','Highlight required fields with an asterisk'=>'Zvýrazniť povinné polia hviezdičkou','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard presmeruje zákazníkov na PayPal, aby zadali platobné informácie.','These options let you change the appearance of the WooCommerce checkout.'=>'Tieto nastavenia vám umožnia zmeniť vzhľad WooCommerce pokladne.','Optionally add some text for the terms checkbox that customers must accept.'=>'Voliteľne pridajte text a podmienky, ktoré musia zákazníci prijať.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Prijímame platby prostredníctvom služby PayPal. Pri spracovávaní platieb sa niektoré vaše údaje odošlú do služby PayPal vrátane informácií, ktoré sú potrebné na spracovanie alebo podporu platby, ako je celková suma nákupu a fakturačné údaje. ','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Viac podrobností nájdete v <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Pravidlách ochrany osobných údajov služby PayPal</a>.','I have read and agree to the website %s'=>'Prečítal/a som si %s a súhlasím s nimi','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Umožňuje platbu šekom. Túto offline platobnú bránu môžete použiť na testovacie účely.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Umožňuje prijímať platby prostredníctvom prevodu na účet.','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'o,na,je,sú,ako,od,com,pre,ako,v,to,k,čo,kde,kto,s,www','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'V tejto sekcií prosím uveďte tretie strany, ktoré spracovávajú platby na Vašej stránke z dôvodu toho, že prichádzajú do styku s údajmi zákazníkov. Pridali sme PayPal ako príklad, ale v prípade že PayPal nevyužívate, prosím odstráňte ho.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Tieto informácie budú zdielané s tretími stranami, ktoré nám pomáhajú pri vykonávaní našich služieb vo vzťahu k Vám, napr--','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'V tejto sekcií prosím uveďte subjekty s ktorými zdielate data a uveďte aj dôvod. Príklady: analytika, marketing, platobné brány, poštovné služby a iné tretie strany.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Členovia nášho tímu majú prístup k informáciám, ktoré nám poskytnete. Napríklad administrátori aj správcovia obchodov majú prístup:','Who on our team has access'=>'Kto v našom tíme má prístup','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Všeobecne uchovávame informácie o vás tak dlho, kým potrebujeme tieto informácie na účely, na ktoré ich zhromažďujeme a používame alebo máme zákonnú povinnosť, aby sme ich aj naďalej uchovávali. Napríklad, informácie o objednávke budeme uchovávať po dobu XXX rokov na daňové a účtovné účely. Toto zahŕňa vaše meno, e-mailovú adresu a fakturačné a dodacie adresy.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Členovia nášho tímu majú prístup k týmto informáciám, ktoré pomáhajú spracovávať objednávky, reklamácie a venovať sa vašim otázkam.','Customer information like your name, email address, and billing and shipping information.'=>'Informácie o zákazníkovi, ako je vaše meno, e-mailová adresa a informácie o fakturácii a dodaní.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informácie o objednávke ako, čo bolo zakúpené, kedy, kde sa má odoslať, a ','What we share with others'=>'Čo zdielame s ostatnými','We will also store comments or reviews, if you choose to leave them.'=>'Uložíme taktiež komentáre alebo hodnotenia, ak ich sa rozhodnete zanechať.','Set up your account for our store'=>'Nastavte svoj účet pre náš obchod','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Ak si vytvoríte účet, uložíme vaše meno, adresu, e-mail a telefónne číslo, ktoré budú použité na vyplnenie údajov v pokladni pri vašich objednávkach.','Improve our store offerings'=>'Pomôžte nám zlepšíť našu ponuku','Process payments and prevent fraud'=>'Spracovanie platieb a ochrana pred podvodom','Comply with any legal obligations we have, such as calculating taxes'=>'Dodržiavame všetky zákonné povinnosti, ktoré máme. Napríklad výpočet daní.','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Keď u nás nakúpite, požiadame vás o poskytnutie informácií vrátane vášho mena, fakturačnej adresy, dodacej adresy, e-mailovej adresy, telefónneho čísla, údajov o kreditnej karte/platbe a voliteľných informácií o účte ako používateľského mena a hesla. Tieto informácie použijeme na účely, ako napríklad:','Send you information about your account and order'=>'Zasielanie informácií o vašom účte a objednávke.','Respond to your requests, including refunds and complaints'=>'Odpovedanie na vaše požiadavky, vrátane refundácií a sťažností','Send you marketing messages, if you choose to receive them'=>'Pošleme vám marketingové oznámenia, ak sa rozhodnete pre ich odber','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Poznámka: Možno budete chcieť podrobnejšie opísať pravidlá súborov cookie a odtiaľto odkazovať na túto sekciu.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Cookies budeme používať aj na sledovanie obsahu košíka, zatiaľ čo budete prechádať našu webovú stránku','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Adresa doručenia: tento údaj je používaný napr. na kalkuláciu poštovného pred zadaním a odoslaním objednávky!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Poloha, IP adresa a typ prehliadača: toto použijeme na účely ako výpočet daní či poštovného','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Produkty ktoré ste si prezerali: tento údaj je používaný napr. na zobrazenie naposledy videných produktov','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Tento vzor obsahuje základné informácie o tom, aké osobné údaje môže váš obchod zhromažďovať, ukladať a zdieľať, ako aj o tom, kto môže mať prístup k týmto údajom. V závislosti od toho, aké nastavenia sú povolené a aké ďalšie doplnky sú použité, špecifické informácie zdieľané v obchode sa budú líšiť. Odporúčame konzultovať s právnikom pri rozhodovaní o tom, aké informácie sa majú zverejniť vo vašich pravidlách ochrany osobných údajov.','What we collect and store'=>'Čo zhromažďujeme a uchovávame','We collect information about you during the checkout process on our store.'=>'Počas nákupu v našom obchode o vás zhromažďujeme informácie.','While you visit our site, we’ll track:'=>'Počas vašej návštevy na našich webových stránkach budeme zaznamenávať:','Items Purchased'=>'Zakúpené položky','Browser User Agent'=>'User Agent prehliadača','Order Number'=>'Číslo objednávky','Access granted'=>'Prístup povolený','Download count'=>'Počet stiahnutí','User email'=>'E-mail používateľa','Token'=>'Kľúč','Payment Tokens'=>'Platobné kľúče','Personal data removed.'=>'Osobné údaje boli odstránené.','Phone Number'=>'Telefónne číslo','optional'=>'voliteľné','Customer Data'=>'Údaje zákazníka','Cloning is forbidden.'=>'Klonovanie je zakázané.','Billing Company'=>'Názov spoločnosti','Billing City'=>'Mesto','Billing Last Name'=>'Priezvisko','Billing First Name'=>'Meno','Download ID'=>'ID sťahovania','display name%1$s %2$s'=>'%1$s %2$s','Shipping Postal/Zip Code'=>'Poštové smerové číslo','Shipping City'=>'Mesto','URL to edit the order'=>'URL na úpravu objednávky','User roleCustomer'=>'Zákazník','Access to Purchased Downloads'=>'Prístup k zakúpeným súborom na prevzatie','Purchased Downloads'=>'Zakúpené súbory na prevzatie','Billing Postal/Zip Code'=>'Poštové smerovacie číslo','Clean up download permissions'=>'Vyčistiť povolenia na prevzatie','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Tento nástroj odstráni povolenia a povolenia s uplynutými verziami s 0 zostávajúcimi súbormi na prevzatie.','Used-up download permissions'=>'Použité povolenia na prevzatie','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Limitovať výsledok na produkty s určitým atribútom. Použite názov taxonomie / atribút slug.','User roleShop manager'=>'Správca obchodu','Unable to create order.'=>'Nepodarilo sa vytvoriť objednávku.','%d permissions deleted'=>'%d oprávnenie zmazané','Removed payment token "%d"'=>'Platobný kľúč "%d" bol