ba pri zmene stavu.','Name of the customer for the order'=>'Meno zákazníka pre objednávku','Blog id of the record on the multisite.'=>'Blog id záznamu na multisite.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Váš obchod nepoužíva zabezpečené pripojenie. Dôrazne odporúčame prevádzkovať celú vašu webovú stránku cez HTTPS pripojenie a udržiavať údaje zákazníkov v bezpečí. <a href="%s">Zistite viac.</a>','Shipping State'=>'Krajina doručenia','WooCommerce pages'=>'Stránky WooCommerce','WooCommerce database version'=>'Verzia databázy WooCommerce','Enable tax rates and calculations'=>'Povoliť dane a ich výpočet','WordPress debug mode'=>'WordPress režim ladenia','WordPress cron'=>'WordPress cron','Manage'=>'Spravovať','Account endpoints'=>'Koncové body účtu','WooCommerce version'=>'Verzia WooCommerce','Settings tab labelPayments'=>'Platby','WordPress version'=>'WordPress verzia','Secure checkout'=>'Bezpečná pokladňa','Retain completed orders'=>'Zachovať dokončené objednávky','Retain cancelled orders'=>'Zachovať zrušené objednávky','Retain failed orders'=>'Zachovať neúspešné objednávky','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Čakajúce objednávky nie sú zaplatené a zákazníci ich nemusia dokončiť. Ak sa tak stane, po nastavenej dobe budú presunuté do koša.','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Chybné objednávky nie sú zaplatené a zákazníci ich nemusia dokončiť. Ak sa tak stane, po nastavenej dobe budú presunuté do koša.','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Zrušené objednávky nie sú zaplatené a zákazníci ich nemusia dokončiť. Ak sa tak stane