mission limits.'=>'Suhosin je pokročilý systém ochrany pre PHP inštalácie. Bol navrhnutý tak, aby na jednej strane chránil vaše servery proti celej škále známych problémov s PHP aplikáciami a na druhej strane proti možným neznámym chybám, ktoré sa nachádzajú v týchto aplikáciách, prípadne v samotnom jadre PHP. Ak Suhosin na svojom serveri povolíte, zrejme ho bude nutné nakonfigurovať a zvýšiť jeho limity odosielania dát.','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'Zoznam výrazov taxonómie, ktoré sa môžu použiť vo vzťahu k stavom objednávky/produktu.','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'Funkcia GZip (gzopen) sa používa na otvorenie databázy GEOIP od spoločnosti MaxMind.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Niektoré webové služby, ako napríklad preprava, používajú protokol SOAP na získanie informácií zo vzdialených serverov. Napríklad cenové ponuky v reálnom čase od spoločnosti FedEx vyžadujú, aby bol protokol SOAP nainštalovaný.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'Emaily vo formáte HTML/Multipart používajú triedu DOMDocument na vygenerovanie inline CSS štýlov v šablónach.','Catalog &amp; search'=>'Katalóg a vyhľadávanie','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'Na vašom serveri nie je aktivovaná trieda %s. Bez nej nebudú fungovať emailové správy typu HTML/Multipart a ani niektoré rozšírenia.','Active plugins.'=>'Aktívne pluginy.','MySQL version.'=>'Verzia MySQL.','Max upload size.'=>'Maximálna veľkosť nahratého súboru.','PHP version.'=>'Verzia PHP.','Server info.'=>'Server info.','Parent theme author URL.'=>'URL adresa nadradenej témy.','WC database version.'=>'Verzia databázy WooCommerce.','Copy for support'=>'Kopírovať pre podporu','PHP post max size'=>'PHP post max size','PHP time limit'=>'PHP time limit','PHP max input vars'=>'PHP max input vars','SUHOSIN installed'=>'SUHOSIN installed','Server environment'=>'Serverové prostredie','WordPress environment'=>'WordPress prostredie','Default timezone is UTC'=>'Predvolená časová zóna je UTC','Visit plugin homepage'=>'Navštíviť stránku pluginu','WooCommerce plugins may use this method of communication when checking for plugin updates.'=>'Doplnky WooCommerce môžu používať tento spôsob komunikácie v prípade, keď kontrolujú aktualizácie pluginu.','Payment gateways can use cURL to communicate with remote servers to authorize payments, other plugins may also use it when communicating with remote services.'=>'Platobné brány môžu používať cURL na komunikáciu so vzdialenými servermi pri autorizácii platieb. Iné pluginy ho tiež môžu používať pri komunikácii so vzdialenými službami.','Skip setup'=>'Preskočiť nastavenie','Learn more about templates'=>'Zistite viac o šablónach','Child theme'=>'Odvodená téma','Page settingMy account'=>'Môj účet','Remote get'=>'Vzdialená metóda Get','Remote post'=>'Vzdialená metóda Post','Parent theme name.'=>'Názov nadradenej témy.','The name of the parent theme.'=>'Názov nadradenej témy.','The root URL of your site.'=>'Koreňová URL adresa vašej webovej stránky.','The version of WooCommerce installed on your site.'=>'Verzia WooCommerce nainštalovaná na vašej webovej stránke.','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Čas (v sekundách), ktorý vaša webová stránka vynaloží na jednu operáciu skôr, ako vyprší časový limit servera.','WooCommerce support'=>'Podpora WooCommerce','Not declared'=>'Nie je zaručená','Sold individually?'=>'Predávané individuálne?','Page settingShop base'=>'Slug pre obchod','Understanding the status report'=>'Pochopenie stavu systému','Log directory writable'=>'Logovací adresár je zapisovateľný','WooCommerce API. Use a consumer key in the username field and a consumer secret in the password field.'=>'API rozhranie WooCommerce. Kľúč zákazníka použite v poli pre meno používateľa a tajné číslo zákazníka použite v poli pre heslo.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Ak upravujete WooCommerce na rodičovskej téme, ktorú ste nevytvorili, odporúčame použiť odvodenú tému. Prečítajte si návod <a href="%s" target="_blank">Ako vytvoriť odvodenú tému</a>.','Decrease existing price by (fixed amount or %):'=>'Znížiť aktuálnu cenu o (fixná suma alebo %):','Consumer secret is invalid.'=>'Tajný kľúč zákazníka je neplatný. ','Backorders?'=>'Povoliť nákup na objednávku? (Keď tovar nie je na sklade)','File does not exist'=>'Súbor neexistuje','In stock?'=>'Na sklade?','Page does not contain the %s shortcode.'=>'Stránka neobsahuje %s shortcode.','Logs'=>'Záznamy','Parent theme version.'=>'Verzia parent témy','Allows customers to checkout without an account.'=>'Umožňuje zákazníkom prejsť do pokladne bez vytvorenia účtu.','Force secure checkout'=>'Použiť bezpečnú pokladňu','Force HTTP when leaving the checkout'=>'Použiť HTTP pri opúštaní košíka','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Je potrebné nastaviť tieto stránky tak, aby WooCommerce vedel kam má poslať užívateľa k pokladni.','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Ak máte nastavenú stránku s "Obchodnými podmienkami", zákazník bude pri prechode k pokladni vyzvaný, aby s nimi súhlasil.','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Koncové body sú pripojené na vaše stránky URL adries aby zvládli konkrétne kroky v priebehu procesu platby. Mali by byť jedinečné.','Pay'=>'Zaplatiť','Emails'=>'E-maily','This option lets you limit which countries you are willing to sell to.'=>'Táto možnosť vám umožňuje obmedziť v ktorých krajinách ste ochotní predávať.','Specific Countries'=>'Špecifické krajiny','Shop base address'=>'Základná adresa obchodu','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Toto je ukážkový obchod na testovacie účely. Objednávky nebudú vybavené.','The following options affect how prices are displayed on the frontend.'=>'Nasledujúce nastavenia určujú ako sú zobrazované ceny na stránke.','Currency'=>'Mena','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Ovplyvňuje v akej mene sú zobrazované ceny v katalógu a ktorú menu budú používať platobné brány.','This controls the position of the currency symbol.'=>'Zadajte pozíciu symbolu meny.','This sets the thousand separator of displayed prices.'=>'Nastavenie oddeľovača tisícov zobrazených cien.','This sets the decimal separator of displayed prices.'=>'Nastavenie oddeľovača desatinných miest zobrazených cien.','This sets the number of decimal points shown in displayed prices.'=>'Tým sa nastaví počet desatinných miest zobrazených v uvedených cenách.','Integration'=>'Integrácia','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'Základná stránka môže byť tiež použitá v <a href="%s">permalink produktu</a>.','This sets the base page of your shop - this is where your product archive will be.'=>'Toto nastavuje základnú stránku obchodu - tu bude archív produktov.','Show products'=>'Zobraziť produkty','Show subcategories'=>'Zobraziť podkategórie','Default sorting (custom ordering + name)'=>'Základné radenie (vlastné radenie + názov)','Popularity (sales)'=>'Popularita (predaja)','Sort by most recent'=>'Zoradiť - najnovšie navrchu','Sort by price (asc)'=>'Zoradiť - podľa ceny (od najnižšej)','Sort by price (desc)'=>'Zoradiť - podľa ceny (od najvyššej)','Redirect to the cart page after successful addition'=>'Presmerovanie na stránku košíka po úspešnom pridaní položky','Enable AJAX add to cart buttons on archives'=>'Povoliť AJAX efekty na po kliknutí na tlačidlo Kúpiť (Pridať do košíka)','Enable stock management'=>'Povoliť riadenie skladových zásob','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'Držať sklad (pre prijaté objednávky) x minút. Keď sa dosiahne limit, nezaplatená objednávka bude zrušená. Nechajte prázdne pre vypnutie funkcie.','Notifications'=>'Upozornenie','Enable low stock notifications'=>'Povoliť upozorňovanie na nízky stav skladových zásob','Enable out of stock notifications'=>'Povoliť upozorňovanie na vyčerpanie skladových zásob','Hide out of stock items from the catalog'=>'Položky, ktoré nie sú na sklade ukryť v katalógu','X-Accel-Redirect/X-Sendfile'=>'X-Accel-Redirect/X-Sendfile','Redirect only'=>'Iba presmerovanie','Downloads require login'=>'Sťahovanie súborov vyžaduje prihlásenie','This setting does not apply to guest purchases.'=>'Toto nastavenie sa nevzťahuje na nákupy neregistrovaných zákazníkov.','Grant access to downloadable products after payment'=>'Udeliť prístup k produktom na stiahnutie po platbe.','This controls what unit you will define weights in.'=>'Tu zadajte jednotky hmotnosti.','This controls what unit you will define lengths in.'=>'Tu zadajte jednotky dĺžkových rozmerov.','Enable the shipping calculator on the cart page'=>'Povoliť výpočet ceny dopravy na stránke košíka','Hide shipping costs until an address is entered'=>'Nezobrazovať ceny prepravy bez zadania adresy','This controls which shipping address is used by default.'=>'Tu nastavíte ktorá dodacia adresa bude predvolená.','Ship to all countries you sell to'=>'Doručiť do všetkých krajín kde predávate','Ship to all countries'=>'Doručiť do všetkých krajín','Ship to specific countries only'=>'Doručiť len do určitých krajín','ID'=>'ID','Copied!'=>'Skopírované!','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'Kód krajiny v dĺžke 2 znakov, napr. SK. Nechajte prázdne pre všetky krajiny.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'Kód štátu/kraja v dĺžke 2 znakov, napr. NY. Nechajte prázdne pre všetky.','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'Mestá pre toto pravidlo. Bodkočiarka(;) oddeľuje viaceré hodnoty. Nechajte prázdne pre použitie vo všetkých mestách.','Rate&nbsp;%'=>'Sadzba v&nbsp;%','Enter a tax rate (percentage) to 4 decimal places.'=>'Zadajte sadzbu dane (v percentách) na 4 desatinné miesta','Enter a name for this tax rate.'=>'Zadajte názov dane.','Priority'=>'Priorita','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Vyberte prioritu pre túto daň. Iba jedna sadzba na prioritu bude použitá. Pre určenie viacerých daňových sadzieb v jednom území potrebujete špecifikovať rozličnú prioritu.','Compound'=>'Zloženie','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'Je toto zložená sadzba? Zložená sadzba sa aplikuje navrch všetkých ostatných sadzieb.','Insert row'=>'Vložiť riadok','Remove selected row(s)'=>'Odstrániť vybraný riadok(riadky)','Import CSV'=>'Import CSV','No row(s) selected'=>'Nevybrali ste žiadny riadok.','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Toto nastavenie je dôležité a ovplyvňuje vstupné ceny. Zmena nastavenia neaktualizuje ceny existujúcich produktov.','No, I will enter prices exclusive of tax'=>'Nie, budem zadávať ceny bez dane','This option determines which address is used to calculate tax.'=>'Toto nastavenie určuje ktorá adresa bude použitá na výpočet dane.','Customer shipping address'=>'Dodacia adresa zákazníka','Customer billing address'=>'Fakturačná adresa zákazníka','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Umožňuje kontrolu nad tým, ktorú daňovú triedu použije na prepravu. Nechajte prázdne pre použitie daňovej sadzby prepravy podľa samotných položiek košíka.','Shipping tax class based on cart items'=>'Daňová sadzba prepravy podľa položiek košíka','Rounding'=>'Zaokrúhľovanie','As a single total'=>'Ako jeden celok','Itemized'=>'Rozpísaná','Marketing'=>'Marketing','Free'=>'Zadarmo','Please copy and paste this information in your ticket when contacting support:'=>'Prosím, skopírujte tieto informácie do správy, keď budete kontaktovať podporu:','Action'=>'Akcia','Measurements'=>'Rozmery','QRCode'=>'QR kód','Copy'=>'Kopírovať','Owner of these keys.'=>'Majiteľ kľúčov.','Select the access type of these keys.'=>'Vyberte typ prístupu kľúčov.','Secret'=>'Tajný kľúč','Custom'=>'Vlastné','Method'=>'Spôsob','Created at'=>'Čas vytvorenia','Updated at'=>'Čas aktualizácie','Add to cart behaviour'=>'Správanie Vložiť do košíka','Define text to show after your product prices. This could be, for example, "inc. Vat" to explain your pricing. You can also have prices substituted here using one of the following: {price_including_tax}, {price_excluding_tax}.'=>'Definuje text, ktorý sa zobrazí za cenami vašich produktov. Môže to byť napríklad text „vrátane DPH“, ktorý vysvetľuje spôsob vytvorenia ceny. Ceny môžete tiež nahradiť pomocou jedného z nasledujúcich zástupných symbolov: {price_including_tax}, {price_excluding_tax}.','Friendly name for identifying this key.'=>'Priateľské meno na identifikáciu tohto kľúča.','Friendly name for identifying this webhook, defaults to Webhook created on %s.'=>'Priateľské meno na identifikáciu tohto webhooku. Predvolene smeruje na Webhook vytvorený %s.','Select when the webhook will fire.'=>'Vyberte, kedy sa webhook spustí.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled